import React, { createContext, useState } from "react";
import "./seccion1.css"
import {Nav } from "../navBar/nav";
import { Novedades } from "../novedades/sliderNovedades";


function Inicio() {
  const [vistaGlobal, setVistaGlobal] = useState("");



  return (
    <VistaGlobalContext.Provider value={{ vistaGlobal, setVistaGlobal }}>
      <div className="seccion1-container">
        <Nav />
        <Novedades/>
        <div className="vista">
          {vistaGlobal}
        </div>
      </div>
    </VistaGlobalContext.Provider>
  )
}

export default Inicio
